import React from 'react'
import './items.css';

class Items extends React.Component {

  render () {
    const {items, onIncrement, onDecrement} = this.props;
    return(

    items.map(item => (
        <item
          key={item.id}
          onDecrement={onDecrement}
          onIncrement={onIncrement}
          item={item}
          />
      ))

)
  }
}


export default Items;
